class Solution():

    def minReverseOperations(self, n: int, p: int, banned: List[int], k: int) -> List[int]:
        "\n    You are given an integer n and an integer p in the range [0, n - 1]. Representing a 0-indexed array arr\xa0of length n where all positions are set to 0's, except position p which is set to 1.\n    You are also given an integer array banned containing some positions from the array. For the ith position in banned, arr[banned[i]] = 0, and banned[i] != p.\n    You can perform multiple operations on arr. In an operation, you can choose a subarray with size k and reverse the subarray. However, the 1 in arr should never go to any of the positions in banned. In other words, after each operation arr[banned[i]] remains 0.\n    Return an array ans where for each i from [0, n - 1], ans[i] is the minimum number of reverse operations needed to bring the 1 to position i in arr, or -1 if it is impossible.\n    A subarray is a contiguous non-empty sequence of elements within an array.\n    The values of ans[i] are independent for all i's.\n    The reverse of an array is an array containing the values in reverse order.\n    "
        from typing import List
        arr = ([0] * n)
        arr[p] = 1
        for i in banned:
            arr[i] = (- 1)

        def reverse_subarray(subarr):
            for i in range(len(subarr)):
                if (subarr[i] == (- 1)):
                    return False
            subarr.reverse()
            return True
        ans = ([(- 1)] * n)
        for i in range(n):
            if (arr[i] == (- 1)):
                continue
            subarr = arr[max(0, ((i - k) + 1)):(i + 1)]
            while (len(subarr) < k):
                subarr.insert(0, 0)
            while (len(subarr) > k):
                subarr.pop(0)
            count = 0
            while (not reverse_subarray(subarr)):
                count += 1
                if (count > n):
                    return ([(- 1)] * n)
            ans[i] = count
        return ans

class Solution():

    def collectTheCoins(self, coins: List[int], edges: List[List[int]]) -> int:
        '\n    There exists an undirected and unrooted tree with n nodes indexed from 0 to n - 1. You are given an integer n and a 2D integer array edges of length n - 1, where edges[i] = [ai, bi] indicates that there is an edge between nodes ai and bi in the tree. You are also given\xa0an array coins of size n where coins[i] can be either 0 or 1, where 1 indicates the presence of a coin in the vertex i.\n    Initially, you choose to start at any vertex in\xa0the tree.\xa0Then, you can perform\xa0the following operations any number of times:\n    Collect all the coins that are at a distance of at most 2 from the current vertex, or\n    Move to any adjacent vertex in the tree.\n    Find the minimum number of edges you need to go through to collect all the coins and go back to the initial vertex.\n    Note that if you pass an edge several times, you need to count it into the answer several times.\n    '
        from typing import List
        n = len(coins)
        graph = [[] for _ in range(n)]
        for (a, b) in edges:
            graph[a].append(b)
            graph[b].append(a)

        def dfs(node, parent):
            coins_collected = coins[node]
            total_edges = 0
            for child in graph[node]:
                if (child != parent):
                    (child_coins, child_edges) = dfs(child, node)
                    coins_collected += child_coins
                    total_edges += (child_edges + (child_coins > 0))
            return (coins_collected, total_edges)
        min_edges = float('inf')
        for i in range(n):
            (coins_collected, total_edges) = dfs(i, (- 1))
            if (coins_collected == sum(coins)):
                min_edges = min(min_edges, total_edges)
        return ((min_edges * 2) if (min_edges != float('inf')) else 0)

class Solution():

    def minimumTime(self, grid: List[List[int]]) -> int:
        '\n    You are given a m x n matrix grid consisting of non-negative integers where grid[row][col] represents the minimum time required to be able to visit the cell (row, col), which means you can visit the cell (row, col) only when the time you visit it is greater than or equal to grid[row][col].\n    You are standing in the top-left cell of the matrix in the 0th second, and you must move to any adjacent cell in the four directions: up, down, left, and right. Each move you make takes 1 second.\n    Return the minimum time required in which you can visit the bottom-right cell of the matrix. If you cannot visit the bottom-right cell, then return -1.\n    '
        from typing import List
        (rows, cols) = (len(grid), len(grid[0]))
        queue = [(0, 0, 0)]
        visited = set()
        while queue:
            (row, col, time) = queue.pop(0)
            if ((row, col) == ((rows - 1), (cols - 1))):
                return time
            if ((row, col) in visited):
                continue
            visited.add((row, col))
            for (r, c) in [((row - 1), col), ((row + 1), col), (row, (col - 1)), (row, (col + 1))]:
                if ((0 <= r < rows) and (0 <= c < cols) and ((r, c) not in visited) and ((time + 1) >= grid[r][c])):
                    queue.append((r, c, (time + 1)))
        return (- 1)

class Solution():

    def findTheString(self, lcp: List[List[int]]) -> str:
        '\n    We define the lcp matrix of any 0-indexed string word of n lowercase English letters as an n x n grid such that:\n    lcp[i][j] is equal to the length of the longest common prefix between the substrings word[i,n-1] and word[j,n-1].\n    Given an\xa0n x n matrix lcp, return the alphabetically smallest string word that corresponds to lcp. If there is no such string, return an empty string.\n    A string a is lexicographically smaller than a string b (of the same length) if in the first position where a and b differ, string a has a letter that appears earlier in the alphabet than the corresponding letter in b. For example, "aabd" is lexicographically smaller than "aaca" because the first position they differ is at the third letter, and \'b\' comes before \'c\'.\n    '
        from typing import List
        n = len(lcp)
        ans = ([''] * n)
        for i in range(n):
            ans[i] = chr((lcp[i][0] + ord('a')))
        for i in range(1, n):
            for j in range(n):
                if (lcp[j][i] != lcp[j][(i - 1)]):
                    break
            else:
                continue
            for k in range(n):
                ans[k] += chr(((lcp[k][i] - lcp[k][(i - 1)]) + ord('a')))
        return (min(ans) if ans else '')

class Solution():

    def handleQuery(self, nums1: List[int], nums2: List[int], queries: List[List[int]]) -> List[int]:
        '\n    You are given two 0-indexed arrays nums1 and nums2 and a 2D array queries of queries. There are three types of queries:\n    For a query of type 1, queries[i]\xa0= [1, l, r]. Flip the values from 0 to 1 and from 1 to 0 in nums1 from index l to index r. Both l and r are 0-indexed.\n    For a query of type 2, queries[i]\xa0= [2, p, 0]. For every index 0 <= i < n, set\xa0nums2[i] =\xa0nums2[i]\xa0+ nums1[i]\xa0* p.\n    For a query of type 3, queries[i]\xa0= [3, 0, 0]. Find the sum of the elements in nums2.\n    Return an array containing all the answers to the third type\xa0queries.\n    '
        from typing import List
        res = []
        for q in queries:
            if (q[0] == 1):
                for i in range(q[1], (q[2] + 1)):
                    nums1[i] = (1 - nums1[i])
            elif (q[0] == 2):
                for i in range(len(nums2)):
                    nums2[i] += (nums1[i] * q[1])
            else:
                res.append(sum(nums2))
        return res

class Solution():

    def minimumScore(self, s: str, t: str) -> int:
        '\n    You are given two strings s and t.\n    You are allowed to remove any number of characters from the string t.\n    The score of the string is 0 if no characters are removed from the string t, otherwise:\n    Let left be the minimum index among all removed characters.\n    Let right be the maximum index among all removed characters.\n    Then the score of the string is right - left + 1.\n    Return the minimum possible score to make t\xa0a subsequence of s.\n    A subsequence of a string is a new string that is formed from the original string by deleting some (can be none) of the characters without disturbing the relative positions of the remaining characters. (i.e., "ace" is a subsequence of "abcde" while "aec" is not).\n    '
        i = 0
        j = 0
        while ((i < len(s)) and (j < len(t))):
            if (s[i] == t[j]):
                j += 1
            i += 1
        return (len(t) - j)

class Solution():

    def minimumVisitedCells(self, grid: List[List[int]]) -> int:
        '\n    You are given a 0-indexed m x n integer matrix grid. Your initial position is at the top-left cell (0, 0).\n    Starting from the cell (i, j), you can move to one of the following cells:\n    Cells (i, k) with j < k <= grid[i][j] + j (rightward movement), or\n    Cells (k, j) with i < k <= grid[i][j] + i (downward movement).\n    Return the minimum number of cells you need to visit to reach the bottom-right cell (m - 1, n - 1). If there is no valid path, return -1.\n    '
        from typing import List
        (m, n) = (len(grid), len(grid[0]))
        queue = [(0, 0, 0)]
        visited = set()
        while queue:
            (i, j, steps) = queue.pop(0)
            if ((i == (m - 1)) and (j == (n - 1))):
                return steps
            for k in range((j + 1), min(((j + grid[i][j]) + 1), n)):
                if ((i, k) not in visited):
                    visited.add((i, k))
                    queue.append((i, k, (steps + 1)))
            for k in range((i + 1), min(((i + grid[i][j]) + 1), m)):
                if ((k, j) not in visited):
                    visited.add((k, j))
                    queue.append((k, j, (steps + 1)))
        return (- 1)

class Solution():

    def minCost(self, basket1: List[int], basket2: List[int]) -> int:
        '\n    You have two fruit baskets containing n fruits each. You are given two 0-indexed integer arrays basket1 and basket2 representing the cost of fruit in each basket. You want to make both baskets equal. To do so, you can use the following operation as many times as you want:\n    Chose two indices i and j, and swap the ith fruit of basket1 with the jth fruit of basket2.\n    The cost of the swap is min(basket1[i],basket2[j]).\n    Two baskets are considered equal if sorting them according to the fruit cost makes them exactly the same baskets.\n    Return the minimum cost to make both the baskets equal or -1 if impossible.\n    '
        from typing import List
        n = len(basket1)
        m = len(basket2)
        if (n != m):
            return (- 1)
        total_cost = (sum(basket1) + sum(basket2))
        if ((total_cost % (2 * n)) != 0):
            return (- 1)
        target_cost = (total_cost // (2 * n))
        diff = []
        for i in range(n):
            if ((basket1[i] != target_cost) and (basket2[i] != target_cost)):
                return (- 1)
            if (basket1[i] != target_cost):
                diff.append((basket1[i] - target_cost))
            if (basket2[i] != target_cost):
                diff.append((basket2[i] - target_cost))
        diff.sort()
        ans = 0
        for i in range(n):
            if (diff[i] >= 0):
                break
            ans += diff[i]
        return (- ans)

class Solution():

    def countQuadruplets(self, nums: List[int]) -> int:
        '\n    Given a 0-indexed integer array nums of size n containing all numbers from 1 to n, return the number of increasing quadruplets.\n    A quadruplet (i, j, k, l) is increasing if:\n    0 <= i < j < k < l < n, and\n    nums[i] < nums[k] < nums[j] < nums[l].\n    '
        count = 0
        n = len(nums)
        for i in range(n):
            for j in range((i + 1), n):
                for k in range((j + 1), n):
                    for l in range((k + 1), n):
                        if (nums[i] < nums[k] < nums[j] < nums[l]):
                            count += 1
        return count

class Solution():

    def putMarbles(self, weights: List[int], k: int) -> int:
        '\n    You have k bags. You are given a 0-indexed integer array weights where weights[i] is the weight of the ith marble. You are also given the integer k.\n    Divide the marbles into the k bags according to the following rules:\n    No bag is empty.\n    If the ith marble and jth marble are in a bag, then all marbles with an index between the ith and jth indices should also be in that same bag.\n    If a bag consists of all the marbles with an index from i to j inclusively, then the cost of the bag is weights[i] + weights[j].\n    The score after distributing the marbles is the sum of the costs of all the k bags.\n    Return the difference between the maximum and minimum scores among marble distributions.\n    '
        from typing import List
        n = len(weights)
        dp = [[float('inf') for _ in range((k + 1))] for _ in range((n + 1))]
        dp[0][0] = 0
        for i in range(1, (n + 1)):
            for j in range(1, (k + 1)):
                for l in range(i):
                    dp[i][j] = min(dp[i][j], (dp[l][(j - 1)] + (max(weights[l:i]) * (i - l))))
        return (dp[n][k] - dp[0][k])
